import { Link, useNavigate } from "react-router-dom";
import {useState, useEffect} from "react";
import styles from '../styles.js';

function JudgeApp( { user } ) { 

    const navigate = useNavigate();

    return (
        <div>
            {user == null ? 
            <div>
                <h1 style={styles.headingStyleApp}>Please log in</h1>
                <div style={styles.buttonContainerStyle}>
                    <button style={styles.buttonStyleApp} onClick={() => navigate('/judge-manager/auth')}>Log in</button>
                </div>
            </div>
                : 
            <div>
                <h1 style={styles.headingStyleApp}>
                    Welcome
                </h1>
                <div style={styles.buttonContainerStyle}>
                    <button style={styles.buttonStyleApp} onClick={() => navigate('/judge-manager/app/user')}>Admin page</button>
                    <button style={styles.buttonStyleApp} onClick={() => navigate('/judge-manager/auth')}>Logout</button>
                </div>
            </div>}
        </div>
    );
  }

  export default JudgeApp;
